create table clin_measurements.lu_growth_chart (
       sex char (1),
       age char (1),
       percent integer,
       chart char(1),
       x integer,
       b0 double precision,
       b1 double precision,
       b2 double precision,
       b3 double precision
       );

comment on table clin_measurements.lu_growth_chart is 'table for growth chart data from the Centres for Disease Control. Each row is data for a cubic spline representing part of a growth curve';
comment on column clin_measurements.lu_growth_chart.sex is 'M=male F=female';
comment on column clin_measurements.lu_growth_chart.age is '1=0-36 months 2=2-18 years 3=2-10.0 years 4=2-11.5 years';
comment on column clin_measurements.lu_growth_chart.percent is 'percentile line to which this equation applies';
comment on column clin_measurements.lu_growth_chart.chart is '1=length-for-age 2=weight-for-age 3=weight-for-length 4=head circumference-for-age 5=stature-for-age 6=weight-for-stature';
comment on column clin_measurements.lu_growth_chart.x is 'age in months from which this equation applies';
comment on column clin_measurements.lu_growth_chart.b0 is 'constant in polynomial equation';
comment on column clin_measurements.lu_growth_chart.b1 is 'co-efficent for X^1 in polynomial equation';
comment on column clin_measurements.lu_growth_chart.b2 is 'co-efficent for X^2 in polynomial equation';
comment on column clin_measurements.lu_growth_chart.b3 is 'co-efficent for X^3 in polynomial equation';


--update db.lu_version set lu_minor=;
